english:
We noticed that the password changed for your Roblox account: {userName}. If you didn't intend to change it, or you think someone else changed it by mistake, please click this link to undo the action:
{urlWithTicket}

If you are happy with your new Roblox password, you don't have to do anything! It's already set up. Please do not reply to this message. If you have any questions, please see the Roblox help page (https://www.roblox.com/help).

translation:
Kata sandi telah diubah untuk akun Roblox kamu: {userName}. Jika kamu tidak bermaksud untuk mengubahnya atau sepertinya orang lain tidak sengaja mengubahnya, klik tautan ini untuk membatalkan tindakan tersebut:
{urlWithTicket}

Jika perubahan ini dilakukan oleh kamu, kamu tidak perlu melakukan apa pun. Jangan membalas email ini. Jika kamu memiliki pertanyaan, silakan kunjungi halaman bantuan Roblox (https://www.roblox.com/help).

english:
Moving forward, subscribers will be granted a monthly lump sum of Robux instead of receiving it in daily increments. Today, we’re depositing {robuxAmount} Robux in your account to make up for the remaining amount you would have earned this month.
{newLine}{newLine}
Check your Roblox Inbox for more details.

translation:
Ke depannya, subscriber akan diberikan Robux secara bulanan dan tidak akan lagi menerimanya dalam bentuk harian. Hari ini, kami akan mendepositokan {robuxAmount} Robux ke akun kamu. Ini adalah jumlah Robux tersisa yang belum kamu terima bulan ini.
{newLine}{newLine}
Buka Inbox Roblox kamu untuk informasi selengkapnya.

